import React from "react";
import logo from "../Images/logo.png"

const Footer = () =>{
    return(
        <footer>
            <div className="container">
                <div className="row">
                    <div className="col-lg-3 col-md-6 col-sm-12">
                        <img src={logo} alt="footer logo" />
                    </div>
                </div>
            </div>
        </footer>

    )
}

export default Footer;
